import React from 'react';
import "./style.css"
    const Dangnhap = function(props){
        return(
            <div className="dangnhap">
                <div>
                    <h6>Quản Lý Xếp Hàng</h6>
                    <h1>Hệ Thống</h1>
                </div>
                <div>
                    <img src='./src/component/img/Group341.png'/>

                </div>
                <div className="frame-one">
                    <p>Tên đăng nhập *</p>
                    <input type="text"/>
                </div>
            </div>
        )
    }

export default Dangnhap;
